var change_bar = function(ship, h, stroke) {
  bar.components[1].position = h;
  bar.components[1].stroke = stroke;
  ship.setUIComponent(bar);
};
//change_bar(ship, [])
//{type: "box",position:[10,5,game.custom.bar_width,0.1],stroke:game.custom.bar_color,width:120},

game.custom.time = 10;
game.custom.trigger = 0;
game.custom.bar_width = 70;
game.custom.bar_x = 10;
game.custom.bar_color = "#35BC0D";
game.custom.aliens = 4;
game.custom.team_name1 = "Orgono";
game.custom.team_name = "Orgono";
game.custom.team_name2 = "Volgauf";
game.custom.team_score_1 = 0;
game.custom.team_score_2 = 0;
game.custom.team_1_id = 0;
game.custom.team_2_id = 1;
game.custom.boss_aliens = []

var start = function(ship) {
  ship.set({x:0,y:0,idle: true});
};

var unblock = function(ship) {
  ship.set({idle: false,
      x: (Math.random() - 0.5) * game.options.map_size * 10,
      y: (Math.random() - 0.5) * game.options.map_size * 10,
      stats: 11111111
  });
};

var scoreboard = {
  id: "scoreboard",
  position: [5,30,8,14],
  visible: true,
  components: [
    { type: "box",position:[-10,26,0.1,50],stroke:"#7A7A7A",width:120},
    { type: "box",position:[60,45,0,10],stroke:"#7A7A7A",width:120},
    { type: "text",position:[-12,10,40,20],value: "N",color:"#CDE"},
    { type: "text",position:[-12,70,40,20],value: "P",color:"#CDE"},
    { type: "text",position:[28,0,60,40],value: " ",color:" "},
    { type: "text",position:[30,60,60,40],value: " ",color:" "},
    ]
};




var actualize_scoreboard = function(ship, name, score, color) {
  scoreboard.components[4].value   = name;
  scoreboard.components[5].value = score;
  scoreboard.components[4].color = color;
  scoreboard.components[4].color = color;
  ship.setUIComponent(scoreboard);
};


var gameover = function(ship) {
  if (ship.id === game.custom.winner) {
    ship.gameover({
      "Congratulations" : "You won!",
      "Your team" : ship.custom.team,
      "Your points" : ship.custom.score + " ( " + (ship.custom.score * 100)/20000 +" )"
    })
  } else {
    ship.gameover({
      "Well..." : "You lose!",
      "Your team" : ship.custom.team,
      "Your points" : ship.custom.score + " ( " + (ship.custom.score * 100)/20000 +"% )"
    })
  }
};

game.modding.commands.t1 = function(req) {
  let number = req.replace('t1 ','');
  game.custom.team_score_1 += Number(number);
};
game.modding.commands.t2 = function(req) {
  let number = req.replace('t2 ','');
  game.custom.team_score_2 += Number(number);
};

var team_assign = function(ship) {
  if (game.custom.number_player_t1 > game.custom.number_player_t2) {
    game.custom.number_player_t2++;
    ship.set({
      team: 1,
      hue: 120
    })
    ship.custom.team = "Volgauf";
  }
   else if (game.custom.number_player_t1 < game.custom.number_player_t2) {
    game.custom.number_player_t1++;
    ship.set({
      team: 0,
      hue: 240
    })
    ship.custom.team = "Orgono";
  }
   else if (game.custom.number_player_t1 === game.custom.number_player_t2) {
    var e = [0,1];
    ship.set({
      team: e[~~(Math.random()*e.length)],
    })
    ship.custom.check = true
  }
};

var check = function(ship) {
    if (ship.team === 0) {
      ship.set({hue: 240})
      game.custom.number_player_t1++;
      ship.custom.team = "Orgono";
    } else {
      ship.set({hue: 120})
      game.custom.number_player_t2++;
      ship.custom.team = "Volgauf";
    }
};
var boss_set = function(alien) {
    alien.set({
      shield: 8000,
      regen: 1,
      damage: 50,
      laser_speed: 90,
      rate: 1
    })
}

this.tick = function(game) {
  if (game.step % 600 === 0) {
    for (let ship of game.ships) {
      if (game.custom.team_name === game.custom.team_name1) {
        actualize_scoreboard(ship, game.custom.team_name2, game.custom.team_score_2, "#0766B5")
        game.custom.team_name = game.custom.team_name2;
      }
      else if (game.custom.team_name === game.custom.team_name2) {
        actualize_scoreboard(ship, game.custom.team_name1, Number(game.custom.team_score_1), "#0DB507")
        game.custom.team_name = game.custom.team_name1;
      }
    }
    for (let ae=0;ae<5;ae++) {
      game.addCollectible({
        x: (Math.random() - 0.5) * game.options.map_size * 10,
        y: (Math.random() - 0.5) * game.options.map_size * 10,
        code: 91
      })
    }
  }
  if (game.step % 660 === 0) {
    if (game.custom.start === true) {
      var alien_code = [10,11,16,17,18];
      var alien_type = [0,1,2,3];
      const minAs = 30;
      const maxAs = 50;
      const minVy = 0.1;
      const maxVy = 0.8;
      const minVx = 0.1;
      const maxVx = 0.8;
      const minAl = 0.8;
      const maxAl = 2.5;
      for (let alien of game.aliens) {
        if (game.aliens.length <= 60) {
          game.addAlien({
            x: (Math.random() - 0.5) * game.options.map_size * 10,
            y: (Math.random() - 0.5) * game.options.map_size * 10,
            code: alien_code[~~(Math.random()*alien_code.length)],
            level: alien_type[~~(Math.random()*alien_type.length)],
            crystal_drop: 20
          })
        }
      }
      for (let asteroid of game.asteroids) {
        if (game.asteroids.length <= 20) {
          game.addAsteroid({
            x: (Math.random() - 0.5) * game.options.map_size * 10,
            y: (Math.random() - 0.5) * game.options.map_size * 10,
            size: Math.random() * (maxAs-minAs) + minAs,
            vx: Math.random() * (maxVx-minVx) + minVx,
            vy:  Math.random() * (maxVy-minVy) + minVy,
          })
        }
      }
    }
  }
  if (game.step % 15 == 0) {
    if (Number(game.custom.team_score_1) >= 20000) {
      game.custom.winner = game.custom.team_1_id;
      game.custom.win = true;
    } else if (Number(game.custom.team_score_2) >= 20000) {
      game.custom.winner = game.custom.team_2_id;
      game.custom.win = true;
    }
    for (let ship of game.ships) {
      if (ship.custom.init !== true) {
        ship.custom.init = true;
        start(ship);
        ship.setUIComponent(scoreboard);
        team_assign(ship);
        ship.custom.score = 0;
        ship.setUIComponent(timer);
        if (game.custom.timer_finished === true) {
            unblock(ship);
            ship.setUIComponent(bar);
            ship.setUIComponent({id:"timer", visible:false});
            ship.setUIComponent(timer);
          }
        }
        if (ship.custom.check === true) {
          check(ship);
          ship.custom.check = false;
        }
        if (ship.custom.instructor_called !== true) {
          ship.custom.instructor_called = true;
          if (ship.team === 0) {
            ship.instructorSays(
              "Welcome to Fitz Arena. You have a faction, and you have to make your faction winning by killing aliens and players."+
              "\nFirst team to gain 20000 points wins."+
              "\nBe careful about not dying, or you'll lose points!",
              "Klaus")
            ship.custom.count = 15;
            ship.custom.count_start = true;
          } else {
            ship.instructorSays(
              "Welcome to Fitz Arena. You have a faction, and you have to make your faction winning by killing aliens and players."+
              "\nFirst team to gain 20000 points wins."+
              "\nBe careful about not dying, or you'll lose points!",
              "Lucina")
          }
        }
      if (game.custom.win === true) {
        gameover(ship);
        game.custom.win = false;
      }
      if (game.custom.aliens == 4) {
        change_bar(ship, [10,5,70,0.1], "#35BC0D")
      }
      else if (game.custom.aliens == 3) {
        change_bar(ship, [10,5,47,0.1], "#FADB29")
      }
      else if (game.custom.aliens === 2) {
        change_bar(ship, [10,5,25,0.1], "#CF0202")
      }
      else if (game.custom.aliens === 1) {
         change_bar(ship, [10,5,2,0.1], "#FFFFFF")
      }
    }
      if (game.custom.boss_creation === true) {
          for (let i=0;i<4;i++) {
            game.custom.boss_aliens.push(game.addAlien({
              x: (Math.random() - 0.5) * game.options.map_size * 10,
              y: (Math.random() - 0.5) * game.options.map_size * 10,
              code: 12,
              level: 2,
              points: 5600,
              crystal_drop: 200,
              weapon_drop: 12
            }))
          }
        for (let alien of game.aliens) {
          if (!game.custom.boss_aliens_init) {
            game.custom.boss_aliens_init = true;
            for (let alien of game.custom.boss_aliens) {
              if (!alien.custom.init) {
                if (alien.id < 0) {
                  game.custom.boss_aliens_init = false;
                } else {
                  alien.custom.init = true;
                  boss_set(alien);
                }
              }
            }
          }
        }
        game.custom.boss_creation = false;
      }
  }
  if (game.step % 60 == 0 ) {
    for (let ship of game.ships) {
      if (ship.custom.count_start == true) {
        ship.custom.count--;
        if (ship.custom.count <= 0) {
          ship.custom.count_start = false;
          ship.hideInstructor();
        }
      }
      if (game.custom.time !== -1) {
          var timer = {
              id: "timer",
              position: [40,39,70,50],
              visible: true,
              components: [
                { type: "text",position:[5,75,80,30],value: game.custom.time,color:"#1CECEC"},
                ]
            }; 
          game.custom.time--;
          ship.setUIComponent(timer);
      } else if (game.custom.time === -1 && game.custom.timer_finished !== true){
          unblock(ship);
          game.custom.boss_creation = true;
          ship.setUIComponent(bar);
          ship.setUIComponent({id:"timer", visible:false});
          game.custom.timer_finished = true;
          game.custom.start = true;
        }
    }
  }
};


var bar = {
  id: "bar",
  position: [27,10,50,2],
  visible: true,
  components: [
    { type: "box",position:[10,0,70,50],stroke:"#7A7A7A",width:120},
    { type: "box",position:[],stroke:"",width:120},
    ]
};

this.event = function(event, game) {
  let ship = event.ship;
  let alien = event.alien;
  let killer = event.killer;
  switch (event.name)
  {
    case "alien_destroyed":
      if (alien !== null)
      {
        game.custom.aliens--;
        if (killer !== null) {
            if (alien.code !== 12) {
              if (killer.team === 0) {
                game.custom.team_score_1 += 100;
                killer.custom.points += 100;
              } else {
                game.custom.team_score_1 += 100;
                killer.custom.points += 100;
              }
            }
            else if (alien.code === 12) {
             if (killer.team === 0) {
                game.custom.team_score_1 += 3000;
                killer.custom.points += 3000;
              } else {
                game.custom.team_score_1 += 3000;
                killer.custom.points += 3000;
              }
            }
        }
      }
      break ;
    case "ship_destroyed":
      if (ship !== null) {
          if (ship.team === 0) {
            game.custom.team_score_1 -= Math.trunc(ship.tier / 100)
            ship.custom.points -= Math.trunc(ship.tier / 100);
          } else {
            game.custom.team_score_1 -= Math.trunc(ship.tier / 100)
            ship.custom.points -= Math.trunc(ship.tier / 100);
          }
        if (killer !== null) {
          if (killer.team === 0) {
            game.custom.team_score_1 += Number(100)
            killer.custom.points += 350;
          } else {
            game.custom.team_score_2 += Number(100)
            killer.custom.points += 350;
          }
        }
      }
  }
};




